            <img src={circledRightarrow} alt="RightArrow" id="rightarrow" />

            <p>Lorem ipsum, dolor sit amet consectetur adipisicing elit. Tempore quod aliquam ipsa quibusdam, nam animi aperiam. Corporis, ullam, quisquam illo iste saepe, ex placeat fugit autem id culpa atque deleniti!</p>
        </div>
